import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import "../QuizResultados.css";

export default function QuizResultado() {
  const { user_id } = useParams();
  const [resultado, setResultado] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchResultado = async () => {
      try {
        const response = await fetch(`http://localhost:3000/quizresultado/${user_id}`);

        if (!response.ok) {
          throw new Error("Nenhum resultado encontrado");
        }

        const data = await response.json();
        setResultado(data);
      } catch (error) {
        console.error("Erro ao carregar resultado:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchResultado();
  }, [user_id]);

  if (loading) {
    return <h2 className="qr-loading">Carregando resultado...</h2>;
  }

  if (!resultado) {
    return <h2 className="qr-empty">Nenhum resultado encontrado.</h2>;
  }

  return (
    <div className="qr-container">
      <div className="qr-card">
        <h1 className="qr-title">{resultado.result_title}</h1>
        <p className="qr-texto">{resultado.result_text}</p>

        <div className="qr-score-box">
          <h3>Pontuação total: <span>{resultado.total_score}</span></h3>
        </div>

        <div className="qr-details">
          <h4>Detalhes salvos</h4>
          <pre>{JSON.stringify(resultado, null, 2)}</pre>
        </div>
      </div>
    </div>
  );
}
